import React, { useEffect, useState } from "react";
import axios from "axios"

function Users() {

    const [users, setusers] = useState([]);

    useEffect(()=> {
        const fetchAllUsers = async () => {
            try {
                const res = await axios.get("http://localhost:3000/users")
                console.log(res)
            }

            catch(err) {
                console.log(err)
            }
        } 

        fetchAllUsers()
    },[])


    return (
        <div>
            <h1>Users List</h1>
            <div className="users">
                {users.map(user => (
                    <div className="user">
                        <p>{users.name}</p>
                        <p>{users.phone}</p>
                        <p>{users.email}</p>
                    </div>
                ))}
            </div>
        </div>
    )
}

export default Users
